css:
.timecop {
  overflow: auto;
}
.timecop .timecop-panel {
  background-color: #3d404e;
}
.timecop .panels {
  display: flex;
  flex-direction: row;
}
.timecop .package-panel {
  display: flex;
  flex-direction: row;
  flex: 1;
}
.timecop .package-panel .list-group {
  overflow: hidden;
}
.timecop .package-panel .inset-panel {
  width: 100%;
}
.timecop .text-info {
  margin-bottom: 1rem;
}
.timecop .timing,
.timecop .list-item {
  display: flex;
  justify-content: space-between;
}
.timecop .timing .inline-block:last-child,
.timecop .list-item .inline-block:last-child {
  margin-right: 0;
}
.timecop .timing {
  margin-bottom: 1rem;
}
.timecop .list-item {
  margin-top: 0.5rem;
  margin-bottom: 0.5rem;
}
.timecop .package {
  color: #d3d5e3;
}
.timecop .package:hover {
  text-decoration: none;
  color: #f9f9fb;
}
.timecop .timecop-line {
  flex: 1 1 0;
  margin-right: 1rem;
  margin-top: .80em;
  border-top: 1px dashed rgba(211, 213, 227, 0.2);
}
.timecop .package:hover + .timecop-line {
  border-color: rgba(211, 213, 227, 0.6);
}
